import "./Navbar.css";

function Navbar() {
  return (
    <nav className="navbar">
      {/* 왼쪽 메뉴 */}
      <div className="navbar-menu">
        <a href="#">자유게시판</a>
        <a href="#">중고마켓</a>
      </div>

      {/* 오른쪽 로그인 */}
      <div className="navbar-actions">
        <button className="login-btn">로그인</button>
      </div>
    </nav>
  );
}

export default Navbar;
